        return None
    count_dict = {}
    for elem in input_list:
        if elem not in count_dict:
            count_dict[elem] += 1
        else:
            count_dict[elem] = 1
    min_count = min(count_dict.values())
    rarest_elements = [k for (k, v) in count_dict.items() if v == min_count]
